INSERT INTO `public_announcements` (`id`, `message`, `user_id`, `created_at`, `updated_at`) VALUES (1,'This is the initial production version of the Workshop online managing application. This version still has multiple bugs and the first update intended to resolve most of them will soon be released. In the meantime, you are kindly asked to test the application as much as possible and report any noticed bugs to the development team using email addresses provided in the footer. We are looking forward to your feedback!',1,'2017-08-03 19:20:48','2017-08-03 19:20:48'),(2,'The statuses of all printers and issues associated with them have been brought into order with the current state of affairs. There is one exception with printer 7 though. \r\n\r\nWe have also introduced access to the website using encrypted protocol https. In order to start using it type https://3dprint.clients.soton.ac.uk and proceed by ignoring all warnings, that your web browser might issue.',1,'2017-10-08 20:10:18','2017-10-08 20:10:18');
